window.bookSummaryJSON = "<p><b>Why survive the apocalypse when you can become the apocalypse?</b></p> <p>Nature is dying. Perhaps before the world is turned into an industrious machine, nature itself can play one final trump card to save itself.</p> <p>Summoned to a new world, a mushroom-loving mycologist needs to grow up and grow stronger in order to accomplish the goal that brought them to this new place: to save nature from the system that the sentient races have created.</p> <p>Stats, levels, classes, and skills are all well and good, but when you're a Child of Poverty in the slums of City Nineteen, there's little you can do to change the world. Not unless you're willing to think outside the box!</p>"; 
